"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Tremor (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/tremor-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H32695766\">",
"      <span class=\"h1\">",
"       What is tremor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Tremor is the medical term for trembling or shaking. A person with tremor has a body part that shakes, and the person cannot control the shaking. Most often this shaking affects the hands or the head, but other body parts can be affected, too. The tremor can be a problem on its own, or it can be caused by another health problem.",
"     </p>",
"     <p>",
"      There are several different types of tremor. They all fall into 1 of 3 main groups:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Resting tremors &mdash; Resting tremors happen while you are sitting or lying down and relaxed. People who have a resting tremor can usually stop the tremor by making a point of moving the part of their body that shakes. &nbsp;",
"       </li>",
"       <li>",
"        Postural tremors &mdash; Postural tremors happen when you try to hold a body part still in a position other than its resting position. If you have a postural tremor, your arms might shake if you hold them out in front of you.",
"       </li>",
"       <li>",
"        Action tremors &mdash; Action tremors happen when you move on purpose.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H32695773\">",
"      <span class=\"h1\">",
"       What are the most common causes of resting tremor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common cause of resting tremor is Parkinson disease. If that is the cause of your tremor, your doctor or nurse will probably focus on treating your Parkinson disease. This will hopefully help reduce your tremor.",
"     </p>",
"     <p>",
"      Other problems that can cause resting tremors include diseases that damage parts of the brain, and a rare condition called Wilson disease, which causes copper to build up in the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H32695780\">",
"      <span class=\"h1\">",
"       What are most common causes of postural and action tremors?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common cause is something called a &ldquo;physiologic&rdquo; tremor. Everyone, even people who are healthy, has a little bit of shaking of the hands. This is what doctors refer to as &ldquo;physiologic tremor.&rdquo; It is normal, and you don't usually notice it, because it is very mild. But in some cases this &ldquo;physiologic&rdquo; or normal tremor can become exaggerated. This can happen:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        If you take certain medicines, such as those used to treat depression, or asthma and other breathing problems",
"       </li>",
"       <li>",
"        If you drink coffee, smoke cigarettes, or take drugs called &ldquo;stimulants,&rdquo; which rev you up",
"       </li>",
"       <li>",
"        If you are anxious, excited, or afraid",
"       </li>",
"       <li>",
"        If your muscles are very tired, for example because you just worked out",
"       </li>",
"       <li>",
"        As the effects of alcohol or other drugs are wearing off",
"       </li>",
"       <li>",
"        If you have an overactive thyroid gland",
"       </li>",
"       <li>",
"        If you have a fever",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your tremor is caused by 1 of the problems listed above, the tremor should go away as soon as the problem goes away. Of course, if your tremor is caused by a medicine, you might not be able to stop taking it. But it might be possible to switch medicines or to lower the dose.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H32695787\">",
"      <span class=\"h1\">",
"       What is essential tremor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Essential tremor is the medical term used to describe tremors that do not seem to be physiologic or linked to any health problem. Doctors do not understand what causes essential tremor, but they do know that it can be passed on in families.",
"     </p>",
"     <p>",
"      People who have essential tremor usually shake when they try to hold their arms out straight. They also tend to shake when they move their hands with a goal in mind. For instance, their hands might shake when they try to write, drink from a glass, or touch their nose with their finger.",
"     </p>",
"     <p>",
"      Essential tremor sometimes even affects the head. This makes it look as though the person is nodding their head \"yes-yes\" or shaking their head \"no-no.\"",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H32695794\">",
"      <span class=\"h1\">",
"       Is there a test to find out the cause of tremor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No there is no test. But your doctor or nurse can learn about a lot about your tremor just by asking you questions and watching you move. Your doctor or nurse might send you for a brain scan or blood tests to make sure your tremor is not caused by something serious. But it's likely that he or she will be able to tell what's wrong just by doing an exam.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H32695801\">",
"      <span class=\"h1\">",
"       How is tremor treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If a tremor is caused by another medical problem, treating that problem &ndash; if it can be treated&mdash;sometimes helps reduce the tremor, too. For example, people whose tremor is caused by high thyroid hormone levels often stop shaking when their hormone levels go back to normal.",
"     </p>",
"     <p>",
"      Even when no other medical problems are involved, there are treatments that can help. There are a few medicines that can reduce a person's tremor. If the medicines are not effective enough and the tremor is severe, it is even possible to have a device implanted in the brain that can help control tremor.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H32695898\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
