"      Chafin CC, Hovinga CA, and Phelps SJ, \"Clonidine in the Treatment of Attention Deficit Hyperactivity Disorder,\"",
"      <i>",
"       Journal of Pediatric Pharmacy Practice",
"      </i>",
"      , 1999, 4(6):308-15.",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Chobanian AV, Bakris GL, Black HR, et al, \"The Seventh Report of the Joint National Committee on Prevention, Detection, Evaluation, and Treatment of High Blood Pressure: The JNC 7 report,\"",
"      <i>",
"       JAMA",
"      </i>",
"      , 2003, 289(19):2560-72.",
